import React from "react";
import Main from "./Main";
import AboutImg from '../Images/About.webp'

const About = () => {

  return (
    <>
      <Main
        heading="I'm Himanshu A MERN "
        highlight="FULL Stack Developer"
        img={AboutImg}
      />
    </>
  )
}

export default About;
